import React from 'react';
import logo from '../assests/log.png';
import '../App.css';
import banner from "../assests/ban.png";


import { Link } from "react-router-dom";

function LogoutNow() {
  alert("You have Successfully Logged Out. Hope to see you again.")
  localStorage.removeItem("IsSignIn");
  window.location.reload();
}

function Nav({IsSignIn, setIsSignIn}) {
  
	return (
<>
    {IsSignIn ? (

  <>
  <header className="header">
  <nav >
  <a href="./"><img src={logo} className="logo" alt=""></img></a>
  
  
	
  <ul className= "menu">
  <li><a href="../">Home</a></li>
    <li><a href="../about">About</a></li>
    <li><a href="../careers">Careers</a></li>
    <li><button onClick={LogoutNow} >Logout</button></li>

  </ul>


</nav>

</header>
</>
      ) : (

		<>
	<header className="header">
  
    <nav >
    
  <a href="./"><img src={logo} className="logo" alt=""></img></a>
  <input className="menu-btn" type="checkbox" id="menu-btn" />
  <label className="menu-icon" htmlFor="menu-btn"><span className="navicon" ></span></label>
  
  
  <i className="fa fa-window-close"></i>

  <ul className="menu">
  <li><a href="/">HOME</a></li>
    <li><a href="/about">ABOUT</a></li>
    <li><a href="./careers">CAREERS</a></li>
  
   <li className="login-btn"><a href="./register">REGISTER</a></li>
   
   
  </ul>
  
  <i className="fa fa-bars" aria-hidden="true"></i>
    </nav>
   
  
  </header>

  

</>

      )}
</>
		)
};

export default Nav;
